import React from "react";
import s from "./Dialog.module.css"
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    let path = "/dialog/" + props.id;
    return (
        <NavLink to={path} activeClassName={s.active} className={s.dialog}>
            <p>{props.name}</p>
        </NavLink>
    );
}

const Message = (props) => {
    return <div className={s.dialog}>{props.message}</div>
}

const Dialog = () => {
    let dialogData =[
        {name:'Igor', id:'1'},
        {name:'Artem', id:'2'},
        {name:'Sasha', id:'3'},
        {name:'Pasha', id:'4'},
        {name:'Yana', id:'5'}
    ]
    let dialogMessage =[
        {name:'Hello', id:'1'},
        {name:'How are you?', id:'2'},
        {name:'You are shit!', id:'3'}
    ]
    let dialogElements = dialogData.map(dialog => <DialogItem name={dialog.name} id={dialog.id}/>);
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItem}>
                {dialogElements}
            </div>
            <div className={s.messages}>
                <Message message={dialogMessage[0].name}/>
                <Message message={dialogMessage[1].name}/>
                <Message message={dialogMessage[2].name}/>
            </div>
        </div>
    );
}
export default Dialog
